pragma solidity ^0.8.28;

import {ITokenBridge} from "./interfaces/ITokenBridge.sol";
import {IMessageBridge} from "./interfaces/IMessageBridge.sol";
import {Ownable} from "@openzeppelin/contracts/access/Ownable.sol";

contract MoveCall is Ownable {
    ITokenBridge internal _tokenBridge;
    IMessageBridge internal _messageBridge;

    constructor() Ownable(msg.sender) {}

    function setBridges(
        ITokenBridge tokenBridge,
        IMessageBridge messageBridge
    ) external onlyOwner {
        _tokenBridge = tokenBridge;
        _messageBridge = messageBridge;
    }

    function receiveMessage(
        bytes32 offChainSignatureId,
        bytes32 sourceUid,
        uint64 sourceChain,
        bytes32 from,
        address to,
        bytes memory payload
    ) external onlyOwner {
        _messageBridge.receiveMessage(
            offChainSignatureId,
            sourceUid,
            sourceChain,
            from,
            to,
            payload
        );
    }

    function attestTokenClaim(
        bytes32 offChainSignatureId,
        bytes32 sourceUid,
        uint64 sourceChain,
        address token,
        uint256 amount,
        uint8 decimals,
        address receiver
    ) external onlyOwner {
        _tokenBridge.attestTokenClaim(
            offChainSignatureId,
            sourceUid,
            sourceChain,
            token,
            decimals,
            amount,
            receiver
        );
    }
}

